/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER fix_direction BEFORE INSERT ON event_log
FOR EACH ROW
    BEGIN
    SET @last_direction = (SELECT ell.direction_id "prev_direction_id" FROM mifare.event_log ell
                                                                       JOIN mifare.devices dd on ell.device_id = dd.id
                                                                      WHERE ell.event_date < NEW.event_date AND ell.cardholder_id = NEW.cardholder_id AND dd.organization_id = (SELECT ddd.organization_id FROM devices ddd where ddd.id = NEW.device_id)
                                                                      ORDER BY ell.event_date DESC LIMIT 1); 
    IF (NEW.direction_id != 1 && NEW.direction_id != 2) THEN
        IF (@last_direction = 1) THEN
            SET NEW.direction_id=2;
        ELSEIF  (@last_direction = 2) THEN
            SET NEW.direction_id=1;
        ELSE
            SET NEW.direction_id=1;
        END IF;
    END IF;
    SET NEW.search_field=(SELECT CONCAT_WS(' ', (SELECT name FROM directions where id=NEW.direction_id),
                                                (SELECT last_name FROM cardholders where id=NEW.cardholder_id),
                                                (SELECT card_number FROM cardholders where id=NEW.cardholder_id),
                                                (SELECT name FROM organizations WHERE id= (SELECT organization_id FROM devices WHERE id=NEW.device_id)),
                                                (SELECT device_number FROM devices where id=NEW.device_id),
                                                (SELECT DATE_FORMAT((NEW.event_date),'%d.%m.%Y %H:%i'))));
    END */;;
